import React from 'react';
import './Log.module.css';
import { Link } from 'react-router-dom';
import Banner from './Banner';



const Log = () => {


    return (
    <React.Fragment>
        <Banner />
        <h1 className="title is-1">Workout Log</h1>
        <p>
            This will be a dynamic chart.
        </p>
        <Link to='/Form'>Home</Link>
    </React.Fragment>

    )};




export default Log;
